import React, { useState, useEffect } from 'react';
import PatientNavBar from '../Components/PatientNavBar'
import { useLocation, useNavigate, useNavigation } from 'react-router-dom';
import { BrowserRouter, Route, Switch, Link } from 'react-router-dom';

// CSS FILES
import styles from '../Styles/Patients.module.css'
// import styles from "../Styles/Doctors.module.css"

function Hospitals() {
    const navigate=useNavigate();
    let location=useLocation();
    let id=40;
    const hospitals = [
        {
            id:1,
            image: "https://res.cloudinary.com/dcmagxgci/image/upload/v1679633976/hospital_t4ebfq.jpg",
            name: "XYZ",
            location: "ABCD",
            rating: "4.5/5"
        },
        {
            id:2,
            image: "https://res.cloudinary.com/dcmagxgci/image/upload/v1679633976/hospital_t4ebfq.jpg",
            name: "XYZ",
            location: "ABCD",
            rating: "4.5/5"
        },
        {
            id:3,
            image: "https://res.cloudinary.com/dcmagxgci/image/upload/v1679633976/hospital_t4ebfq.jpg",
            name: "XYZ",
            location: "ABCD",
            rating: "4.5/5"
        },
        {
            id:1,
            image: "https://res.cloudinary.com/dcmagxgci/image/upload/v1679633976/hospital_t4ebfq.jpg",
            name: "XYZ",
            location: "ABCD",
            rating: "4.5/5"
        },
        {
            id:2,
            image: "https://res.cloudinary.com/dcmagxgci/image/upload/v1679633976/hospital_t4ebfq.jpg",
            name: "XYZ",
            location: "ABCD",
            rating: "4.5/5"
        },
        {
            id:3,
            image: "https://res.cloudinary.com/dcmagxgci/image/upload/v1679633976/hospital_t4ebfq.jpg",
            name: "XYZ",
            location: "ABCD",
            rating: "4.5/5"
        },
    ];

    return (
        <>
            <PatientNavBar />
            <center>
                    <div className={styles.hospital_cards}>
                        {hospitals.map((hospital)=>{
                            return (
                                <Link to={`/40+${hospital.id}`}>
                                    <div className={styles.card}>
                                        <div className={styles.img_container}>
                                            <img src={hospital.image} className={styles.image} />
                                        </div>
                                        <p className={styles.details} style={{textDecoration: "none"}}>Name : {hospital.name}</p>
                                        <p className={styles.details} style={{textDecoration: "none"}}>Location : {hospital.location}</p>
                                        <p className={styles.details} style={{textDecoration: "none"}}>Rating : {hospital.rating}</p>
                                        <a  className={styles.availability}
                                        onClick={(e)=>navigate(`/patient/${id}/${hospital.id}`)}
                                        >Doctor's Availability {'-->'}</a>
                                    </div>
                                </Link>
                            )
                        })}
                    </div>
            </center>
            <br/>
            <br/>
            <br/>
            <br/>
            <br/>
            <br/>
            <br/>
        </>
    )
}

export default Hospitals
